  [],\n\t\"revision_timestamp\": \"2016-05-25T00:41:36.091414\",\n\t\"name\": \"post-accident-toxicology-testing-system-2-0-patts-ii\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"PATTS II enables all railroad post-accident
  toxicological testing forms and paperwork to be stored and archived electronically
  and is the repository for new and legacy FRA post-accident toxicological testing
  program documentation, specimen lab results, and railroad accident data.  It allows
  FRA alcohol and drug program personnel access to query the accident files, trend
  data, and develop reports to enable effective use of the data by FRA management.
  This project is critical to effective management and policy planning in this congressionally
  mandated program.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
